            <method name="beforeOpen"><![CDATA[	this.queryText = this.queryText.replace("--$facilityParam$", " and facility.id = " + params["facilityId"]);

if (params["gender"].value){
	this.queryText = this.queryText.replace("--$genderParam$", " and p.details -> ''gender'' ->> ''display'' ilike ''" + params["gender"] + "''");
}
if (params["ageFrom"].value){
	this.queryText = this.queryText.replace("--$ageFromParam$", " and EXTRACT(YEAR from AGE(NOW(), (p.details ->> ''dob'')::date)) >= " + params["ageFrom"]);
}
if (params["ageTo"].value){
	this.queryText = this.queryText.replace("--$ageToParam$", " and EXTRACT(YEAR from AGE(NOW(), (p.details ->> ''dob'')::date)) <= " + params["ageTo"]);
}
if (params["state"].value){
	this.queryText = this.queryText.replace("--$stateParam$", " and p.details -> ''state'' ->> ''id'' = ''" + params["state"] + "''");
}
if (params["province"].value){
	this.queryText = this.queryText.replace("--$provinceParam$", " and p.details -> ''province'' ->> ''id'' = ''" + params["province"] + "''");
}
if (params["currentStatus"].value){
	this.queryText = this.queryText.replace("--$currentStatusParam$", " and (client_status_fd.data -> ''hiv_current_status'' ->> ''display'') = ''" + params["currentStatus"] + "''");
	this.queryText = this.queryText.replace("--$currentStatusParam2$", " and client_status.current_status = ''" + params["currentStatus"] + "''");
}


if (params["dateCurrentStatusFrom"].value){
	this.queryText = this.queryText.replace("--$dateCurrentStatusFromParam$", " and (client_status_fd.data ->> ''date_hiv_current_status'') >= ''" + params["dateCurrentStatusFrom"] + "''");
	this.queryText = this.queryText.replace("--$dateCurrentStatusFromParam2$", " and (client_status.date_hiv_current_status) >= ''" + params["dateCurrentStatusFrom"] + "''");

}
if (params["dateCurrentStatusTo"].value){
	this.queryText = this.queryText.replace("--$dateCurrentStatusToParam$", " and (client_status_fd.data ->> ''date_hiv_current_status'') <= ''" + params["dateCurrentStatusTo"] + "''");
	this.queryText = this.queryText.replace("--$dateCurrentStatusToParam2$", " and (client_status.date_hiv_current_status) <= ''" + params["dateCurrentStatusTo"] + "''");
}
if (params["regimen"].value){
	this.queryText = this.queryText.replace("--$regimenParam$", " and (phar_fd.data -> ''regimen'' ->> ''name'') = ''" + params["regimen"] + "''");
}
if (params["enrolmentDateFrom"].value){
	this.queryText = this.queryText.replace("--$enrolmentDateFromParam$", " and (enrollment_fd.data ->> ''date_hiv_enrollment'') >= ''" + params["enrolmentDateFrom"] + "''");
	this.queryText = this.queryText.replace("--$enrolmentDateFromParam2$", " and enrollment.date_registration >= ''" + params["enrolmentDateFrom"] + "''");
}
if (params["enrolmentDateTo"].value){
	this.queryText = this.queryText.replace("--$enrolmentDateToParam$", " and (enrollment_fd.data ->> ''date_hiv_enrollment'') <= ''" + params["enrolmentDateTo"] + "''");
	this.queryText = this.queryText.replace("--$enrolmentDateToParam2$", " and enrollment.date_registration <= ''" + params["enrolmentDateTo"] + "''");
}
if (params["currentViralLoadDateFrom"].value){
	this.queryText = this.queryText.replace("--$currentViralLoadDateFromParam$", " and lab_enc.date_encounter >= ''" + params["currentViralLoadDateFrom"] + "''");
	this.queryText = this.queryText.replace("--$currentViralLoadDateFromParam2$", " and laboratory.last_viral_load_date >= ''" + params["currentViralLoadDateFrom"] + "''");
}
if (params["currentViralLoadDateTo"].value){
	this.queryText = this.queryText.replace("--$currentViralLoadDateToParam$", " and lab_enc.date_encounter <= ''" + params["currentViralLoadDateTo"] + "''");
	this.queryText = this.queryText.replace("--$currentViralLoadDateToParam2$", " and laboratory.last_viral_load_date <= ''" + params["currentViralLoadDateTo"] + "''");

}
if (params["clinicStage"].value){
	this.queryText = this.queryText.replace("--$clinicStageParam$", " and (visit_fd.data -> ''clinic_stage'' ->> ''display'') = ''" + params["clinicStage"] + "''");
	//this.queryText = this.queryText.replace("--$clinicStageParam2$", " and clinic_followup.last_clinic_stage is not null");
}
if (params["artStartDateFrom"].value){
	this.queryText = this.queryText.replace("--$artStartDateFromParam$", " and (art_fd.data ->> ''date_art_start'') >= ''" + params["artStartDateFrom"] + "''");
	this.queryText = this.queryText.replace("--$artStartDateFromParam2$", " and art_commencement.date_art_start >= ''" + params["artStartDateFrom"] + "''");
}
if (params["artStartDateTo"].value){
	this.queryText = this.queryText.replace("--$artStartDateToParam$", " and (art_fd.data ->> ''date_art_start'') <= ''" + params["artStartDateTo"] + "''");
	this.queryText = this.queryText.replace("--$artStartDateToParam2$", " and art_commencement.date_art_start <= ''" + params["artStartDateTo"] + "''");
}]]></method>
