            <xml-property name="queryText"><![CDATA[WITH pharmacy AS
  (SELECT * FROM
     (SELECT phar_enc.patient_id,
             (phar_fd.data -> ''regimen'' ->> ''name'') AS current_regimen,
             phar_fd.data ->> ''date_dispensed'' AS date_last_refill,
             CASE
             	WHEN (phar_fd.data ->> ''duration_unit'') = ''weeks'' THEN (phar_fd.data ->> ''duration'')::integer * 7
             	WHEN (phar_fd.data ->> ''duration_unit'') = ''months'' THEN (phar_fd.data ->> ''duration'')::integer * 30
             	ELSE (phar_fd.data ->> ''duration'')::integer
             END last_refill_duration,
             current_rl.name AS current_regimen_line,
             rank() over(PARTITION BY phar_enc.patient_id ORDER BY phar_enc.patient_id, (phar_fd.data ->> ''date_dispensed'')::date DESC) rn
      FROM encounter phar_enc
	  JOIN form_data phar_fd ON phar_fd.encounter_id = phar_enc.id
      LEFT JOIN regimen_line current_rl ON current_rl.id = (phar_fd.data -> ''regimen'' ->> ''regimenLineId'')::integer
      WHERE phar_enc.form_code = ''4ab293ff-6837-41e8-aa85-14f25ce59ef0''
        AND (phar_fd.data ->> ''type'')::int = 0 -- type = 0 means regimen_prescriptions only and prescription_status = 1 means the prescription was dispensed
        AND (phar_fd.data ->> ''prescription_status'')::int = 1
	  --$regimenParam$
        ) enc
   WHERE rn = 1),

    enrollment AS
  (SELECT * FROM
     (SELECT enrollment_enc.patient_id,
             enrollment_fd.data -> ''entry_point'' ->> ''display'' AS entryPoint,
             (enrollment_fd.data ->> ''date_confirmed_hiv'') AS date_confirmed_hiv,
	  		 (enrollment_fd.data ->> ''date_hiv_enrollment'') as date_registration,
	 		 (enrollment_fd.data -> ''status_registration'' ->> ''display'') as status_registration,
             rank() over(PARTITION BY enrollment_enc.patient_id ORDER BY enrollment_enc.date_encounter DESC) rn
      FROM encounter enrollment_enc
      JOIN form_data enrollment_fd ON enrollment_fd.encounter_id = enrollment_enc.id
      WHERE enrollment_enc.form_code = ''0871d0b9-0fb3-4579-bdec-77d684b0cea6''
	 	--$enrolmentDateFromParam$
	  --$enrolmentDateToParam$
	 ) enc
   WHERE rn = 1 ),

   client_status AS
  (SELECT * FROM
     (SELECT client_status_enc.patient_id,
	 		 (client_status_fd.data -> ''hiv_current_status'' ->> ''display'') as current_status,
			 (client_status_fd.data ->> ''date_hiv_current_status'') as date_hiv_current_status,
             rank() over(PARTITION BY client_status_enc.patient_id
                         ORDER BY client_status_enc.date_encounter, client_status_fd.id DESC) rn
      FROM encounter client_status_enc
      INNER JOIN form_data client_status_fd ON client_status_fd.encounter_id = client_status_enc.id
      WHERE client_status_enc.form_code = ''5210f079-27e9-4d01-a713-a2c400e0926c''
	 --$currentStatusParam$
	  --$dateCurrentStatusFromParam$
	  --$dateCurrentStatusToParam$
	 ) enc
   WHERE rn = 1 ),

   art_commencement AS
  (SELECT art_enc.patient_id,
          (art_fd.data ->> ''date_art_start'') as date_art_start,
		  (art_fd.data -> ''functional_status'' ->> ''display'') as baseline_functional_status,
		  (art_fd.data -> ''clinic_stage'' ->> ''display'') as baseline_clinic_stage,
		  (art_fd.data ->> ''body_weight'') as baseline_weight,
		  (art_fd.data ->> ''height'') as baseline_height,
		  baseline_regimen_line.name as first_regimen_line,
		  baseline_regimen.name as first_regimen
   FROM encounter art_enc
    JOIN form_data art_fd ON art_fd.encounter_id = art_enc.id
   LEFT JOIN regimen_line baseline_regimen_line ON baseline_regimen_line.id = (art_fd.data ->> ''regimen_line_id'')::integer
   LEFT JOIN regimen baseline_regimen ON baseline_regimen.id = (art_fd.data ->> ''regimen_id'')::integer
   WHERE art_enc.form_code = ''0a8b31d2-9397-42f8-9300-688b62c75571''
  --$artStartDateFromParam$
   --$artStartDateToParam$
  ),

   clinic_followup AS
  (SELECT * FROM
     (SELECT visit_enc.patient_id,visit_fd.data,
	  		 (visit_fd.data -> ''clinic_stage'' ->> ''display'') as last_clinic_stage,
			 visit_enc.date_encounter as last_visit_date,
             rank() over(PARTITION BY visit_enc.patient_id ORDER BY visit_enc.date_encounter DESC) rn
      FROM encounter visit_enc
      JOIN form_data visit_fd ON visit_fd.encounter_id = visit_enc.id
      AND visit_enc.form_code = ''5c8741de-f722-4e0a-a505-24e039bf4340''
	 	--$clinicStageParam$
	 ) enc
   WHERE rn = 1 ),

    laboratory AS
  (SELECT * FROM
     (SELECT lab_enc.patient_id,
             lab_enc.date_encounter AS last_viral_load_date,
             lab_fd.data -> ''reported_result''->-1->>''result_reported'' AS last_viral_load,
             lab_fd.data -> ''viral_load_indication'' ->> ''display'' AS viral_load_type,
             rank() over(PARTITION BY lab_enc.patient_id ORDER BY lab_enc.date_encounter DESC) rn
      FROM encounter lab_enc
      JOIN form_data lab_fd ON lab_fd.encounter_id = lab_enc.id
      AND lab_fd.data ->> ''description'' ilike ''Viral load''
      WHERE lab_enc.form_code = ''87cb9bc7-ea0d-4c83-a70d-b57a5fb7769e''
	 	--$currentViralLoadDateFromParam$
	  	--$currentViralLoadDateToParam$
	 ) enc
    WHERE rn = 1 ),

	appointment as
   (SELECT * FROM
     (SELECT appointment.patient_id,
	  		 appointment.detail ->> ''appointment_date''  as next_clinic_date,
             rank() over(PARTITION BY appointment.patient_id ORDER BY appointment.date DESC) rn
      FROM appointment appointment
	  WHERE appointment.detail -> ''appointment_type'' ->> ''display'' = ''Clinic Visit''
       ) enc
   WHERE rn = 1 ),

patient as (
 SELECT p.id,
	facility.id as facilityId, facility.name as facilityName,
	p.details -> ''state'' ->> ''name'' as state, p.details -> ''province'' ->> ''name'' as province,
	p.details ->> ''firstName'' as firstName, p.details ->> ''lastName'' as lastName,
	p.patient_number, p.details ->> ''dateRegistration'' as date_registration,
	p.details ->> ''dob'' as dob, EXTRACT(YEAR from AGE(NOW(), (p.details ->> ''dob'')::date)) as age,
	p.details -> ''gender'' ->> ''display'' as gender, p.details -> ''maritalStatus'' ->> ''display'' as maritalStatus,
	p.details -> ''education'' ->> ''display'' as education, p.details -> ''occupation'' ->> ''display'' as occupation,
	p.details ->> ''street'' as address, p.details ->> ''mobilePhoneNumber'' as phoneNumber
 FROM patient p
 INNER JOIN organisation_unit facility on p.organisation_unit_id = facility.id
 WHERE true
 --$facilityParam$
	--$genderParam$
	--$ageFromParam$
	--$ageToParam$
	--$stateParam$
	--$provinceParam$
)

  SELECT
  enrollment.patient_id, enrollment.entryPoint, enrollment.date_confirmed_hiv, enrollment.date_registration, enrollment.status_registration,
  patient.facilityId, patient.facilityName, patient.state, patient.province, patient.firstName, patient.lastName, patient.patient_number, patient.dob, patient.age, patient.gender, patient.maritalStatus, patient.education, patient.occupation, patient.phoneNumber, patient.address,
  art_commencement.date_art_start ,art_commencement.baseline_functional_status, art_commencement.baseline_clinic_stage, art_commencement.baseline_weight, art_commencement.baseline_height, art_commencement.first_regimen_line, art_commencement.first_regimen,
  client_status.current_status, client_status.date_hiv_current_status,
  pharmacy.current_regimen_line, pharmacy.current_regimen, pharmacy.date_last_refill, pharmacy.last_refill_duration,
  clinic_followup.last_clinic_stage , clinic_followup.last_visit_date,
  appointment.next_clinic_date,
  laboratory.last_viral_load_date, laboratory.last_viral_load, laboratory.viral_load_type
  FROM enrollment
 JOIN patient ON patient.id = enrollment.patient_id
LEFT JOIN pharmacy ON pharmacy.patient_id = enrollment.patient_id
LEFT JOIN laboratory ON laboratory.patient_id = enrollment.patient_id
LEFT JOIN clinic_followup ON clinic_followup.patient_id = enrollment.patient_id
LEFT JOIN art_commencement ON art_commencement.patient_id = enrollment.patient_id
LEFT JOIN client_status ON client_status.patient_id = enrollment.patient_id
LEFT JOIN appointment ON appointment.patient_id = appointment.patient_id
WHERE true
--$currentStatusParam2$
--$dateCurrentStatusFromParam2$
	  --$dateCurrentStatusToParam2$
	  --$enrolmentDateFromParam2$
	  --$enrolmentDateToParam2$
	  --$currentViralLoadDateFromParam2$
	  	--$currentViralLoadDateToParam2$
	  	--$artStartDateFromParam2$
   --$artStartDateToParam2$
--$clinicStageParam20$

-- TODO
-- Add condition to only pick regimen that have been dispenced, check regimen status
-- calculate VL due date.
-- review appointmentType = ''Clinic Visit'', now an array]]></xml-property>
