            <xml-property name="queryText"><![CDATA[WITH pharmacy AS
  (SELECT * FROM
     (SELECT phar_enc.patient_id,
             (phar_fd.data -> ''regimen'' ->> ''name'') AS current_regimen,
             phar_fd.data ->> ''date_dispensed'' AS date_last_refill,
             CASE
             	WHEN (phar_fd.data ->> ''duration_unit'') = ''weeks'' THEN (phar_fd.data ->> ''duration'')::integer * 7
             	WHEN (phar_fd.data ->> ''duration_unit'') = ''months'' THEN (phar_fd.data ->> ''duration'')::integer * 30
             	ELSE (phar_fd.data ->> ''duration'')::integer
             END last_refill_duration,
             current_rl.name AS current_regimen_line,
             rank() over(PARTITION BY phar_enc.patient_id ORDER BY phar_enc.patient_id, (phar_fd.data ->> ''date_dispensed'')::date DESC) rn
      FROM encounter phar_enc, form_data phar_fd
      LEFT JOIN regimen_line current_rl ON current_rl.id = (phar_fd.data -> ''regimen'' ->> ''regimenLineId'')::integer
      WHERE phar_enc.form_code = ''4ab293ff-6837-41e8-aa85-14f25ce59ef0''
        AND phar_fd.encounter_id = phar_enc.id
        AND (phar_fd.data ->> ''type'')::int = 0 -- type = 0 means regimen_prescriptions only and prescription_status = 1 means the prescription was dispensed
        AND (phar_fd.data ->> ''prescription_status'')::int = 1
        AND phar_enc.archived = 0
        AND (COALESCE(TRIM(phar_fd.data ->> ''date_dispensed'', '''')) = '''') IS FALSE -- less than the reporting period
        AND (phar_fd.data ->> ''date_dispensed'')::date <= ? ) enc
   WHERE rn = 1),

	 tpt_pharmacy AS
  (SELECT * FROM
     (SELECT phar_enc.patient_id,
             (phar_fd.data ->> ''start_date'') AS tpt_start_date,
             CASE
                 WHEN phar_fd.data ->> ''start_date'' IS NULL
                      OR (coalesce(TRIM(phar_fd.data ->> ''start_date''), '''') = '''') THEN ''No''
                 ELSE ''Yes''
             END tpt_given,
             rank() over(PARTITION BY phar_enc.patient_id ORDER BY phar_enc.patient_id, (phar_fd.data ->> ''date_dispensed'')::date DESC) rn
      FROM encounter phar_enc
      JOIN form_data phar_fd ON phar_fd.encounter_id = phar_enc.id
      WHERE phar_enc.form_code = ''4ab293ff-6837-41e8-aa85-14f25ce59ef0''
      AND phar_enc.archived = 0
        AND (phar_fd.data ->> ''type'')::int = 1 -- type = 1 means drug_prescriptions only and prescription_status = 1 means the prescription was dispensed
        AND (phar_fd.data ->> ''prescription_status'')::int = 1
        AND phar_fd.data ->''drugs''->0->''drug'' ->> ''name'' ilike ''Isoniazid''
        AND (COALESCE(TRIM(phar_fd.data ->> ''date_dispensed'', '''')) = '''') IS FALSE -- less than two years before the reporting period
        AND (phar_fd.data ->> ''date_dispensed'')::date >= (?::date - INTERVAL ''2 year'') ) enc
   WHERE rn = 1),

     laboratory AS
  (SELECT * FROM
     (SELECT lab_enc.patient_id,
             lab_enc.date_encounter AS last_viral_load_date,
             lab_fd.data -> ''reported_result''->-1->>''result_reported'' AS last_viral_load,
             lab_fd.data -> ''viral_load_indication'' ->> ''display'' AS viral_load_type,
             rank() over(PARTITION BY lab_enc.patient_id ORDER BY lab_enc.date_encounter DESC) rn
      FROM encounter lab_enc
      LEFT JOIN form_data lab_fd ON lab_fd.encounter_id = lab_enc.id
      AND lab_fd.data ->> ''description'' ilike ''Viral load''
      WHERE lab_enc.form_code = ''87cb9bc7-ea0d-4c83-a70d-b57a5fb7769e'' -- less than the reporting period
        AND lab_enc.archived = 0
        AND lab_enc.date_encounter <= ?  ) enc
   WHERE rn = 1 ),

   clinic_followup AS
  (SELECT * FROM
     (SELECT visit_enc.patient_id,
             visit_fd.data -> ''pregnant'' ->> ''display'' AS pregnancy_status,
             rank() over(PARTITION BY visit_enc.patient_id ORDER BY visit_enc.date_encounter DESC) rn
      FROM encounter visit_enc
      LEFT JOIN form_data visit_fd ON visit_fd.encounter_id = visit_enc.id
      AND (visit_fd.data ->> ''date_visit'' <> '''') IS NOT TRUE
      AND (visit_fd.data ->> ''date_visit'')::date <= ? -- less than the reporting period
      AND visit_enc.form_code = ''5c8741de-f722-4e0a-a505-24e039bf4340''
      WHERE visit_fd.data -> ''pregnant'' ->> ''display'' IS NOT NULL
      AND visit_enc.archived = 0 ) enc
   WHERE rn = 1 ),

   enrollment AS
  (SELECT * FROM
     (SELECT enrollment_enc.patient_id,
             enrollment_fd.data -> ''entry_point'' ->> ''display'' AS entryPoint,
             (enrollment_fd.data ->> ''date_confirmed_hiv'') AS date_confirmed_hiv,
             (enrollment_fd.data -> ''enrollment_setting'' ->> ''display'') AS enrollment_setting,
             rank() over(PARTITION BY enrollment_enc.patient_id ORDER BY enrollment_enc.date_encounter DESC) rn
      FROM encounter enrollment_enc
      LEFT JOIN form_data enrollment_fd ON enrollment_fd.encounter_id = enrollment_enc.id
      JOIN patient p on p.id = enrollment_enc.patient_id
      WHERE enrollment_enc.form_code = ''0871d0b9-0fb3-4579-bdec-77d684b0cea6''
      AND enrollment_enc.archived = 0
      --$facility
	  --$facility_id
) enc
   WHERE rn = 1 ),

     art_commencement AS
  (SELECT art_enc.patient_id,
          (art_fd.data ->> ''date_art_start'') AS date_art_start,
          baseline_regimen_line.name AS first_regimen_line,
          baseline_regimen.name AS first_regimen
   FROM encounter art_enc
   INNER JOIN form_data art_fd ON art_fd.encounter_id = art_enc.id
   LEFT JOIN regimen_line baseline_regimen_line ON baseline_regimen_line.id = (art_fd.data ->> ''regimen_line_id'')::integer
   LEFT JOIN regimen baseline_regimen ON baseline_regimen.id = (art_fd.data ->> ''regimen_id'')::integer
   WHERE art_enc.form_code = ''0a8b31d2-9397-42f8-9300-688b62c75571''
   AND art_enc.archived = 0
     AND EXTRACT(YEAR
                 FROM (art_fd.data ->> ''date_art_start'')::date) >= ?
     AND EXTRACT(YEAR
                 FROM (art_fd.data ->> ''date_art_start'')::date) <= ?
     AND EXTRACT(MONTH
                 FROM (art_fd.data ->> ''date_art_start'')::date) >= ?
     AND EXTRACT(MONTH
                 FROM (art_fd.data ->> ''date_art_start'')::date) <= ? ),

   	client_status AS
  (SELECT * FROM
     (SELECT client_status_enc.patient_id,
             client_status_enc.date_encounter AS date_e,
             CASE
                 WHEN (client_status_fd.data -> ''hiv_current_status'' ->> ''display'') = (''Died (Confirmed)'') THEN ''DEAD''
                 WHEN (pharmacy.date_last_refill)::date + (pharmacy.last_refill_duration)::int + 28 > ?
                      AND (client_status_fd.data -> ''hiv_current_status'' ->> ''display'') = (''ART Transfer Out'') THEN ''ART TRANSFER OUT''
                 WHEN (pharmacy.date_last_refill)::date + (pharmacy.last_refill_duration)::int + 28 <= ? THEN ''ACTIVE''
                 WHEN (pharmacy.date_last_refill)::date + (pharmacy.last_refill_duration)::int + 28 > ? THEN ''IIT''
                 ELSE client_status_fd.data -> ''hiv_current_status'' ->> ''display''
             END AS current_status,
             rank() over(PARTITION BY client_status_enc.patient_id
                         ORDER BY client_status_enc.date_encounter, client_status_fd.id DESC) rn
      FROM encounter client_status_enc
      LEFT JOIN pharmacy ON client_status_enc.patient_id = pharmacy.patient_id
      INNER JOIN form_data client_status_fd ON client_status_fd.encounter_id = client_status_enc.id
      WHERE client_status_enc.form_code = ''5210f079-27e9-4d01-a713-a2c400e0926c''
      AND client_status_enc.archived = 0 ) enc
   WHERE rn = 1 ),

     dmoc AS
  (SELECT * FROM
     (SELECT dmoc_enc.patient_id,
             dmoc_fd.data ->> ''date_devolved'' AS dmoc_date,
             dmoc_fd.data -> ''type_dmoc'' ->> ''display'' AS dmoc_type,
             CASE
             	WHEN dmoc_fd.data ->> ''date_devolved'' IS NOT NULL
             		AND (coalesce(TRIM(dmoc_fd.data ->> ''date_devolved''), '''') = '''') IS FALSE THEN ''Yes''
             	ELSE ''No''
             END dmoc_commenced,
             rank() over(PARTITION BY dmoc_enc.patient_id ORDER BY dmoc_enc.date_encounter DESC) rn
      FROM encounter dmoc_enc
      LEFT JOIN form_data dmoc_fd ON dmoc_fd.encounter_id = dmoc_enc.id
      WHERE dmoc_enc.form_code = ''d1477f0c-3320-4bfe-abac-d26388cb3b09'' -- less than the reporting period
      AND dmoc_enc.archived = 0
        AND dmoc_enc.date_encounter <= ?  ) enc
   WHERE rn = 1 ),

     eac AS
  (SELECT *
   FROM
     (SELECT eac_enc.patient_id,
             CASE
                 WHEN eac_fd.data ->> ''date_eac1'' IS NOT NULL THEN ''Yes''
                 ELSE ''No''
             END eac_commenced,
             eac_fd.data ->> ''date_eac1'' AS date_eac_commenced,
             eac_fd.data ->> ''date_eac2'' AS date_eac2,
             eac_fd.data ->> ''date_eac3'' AS date_eac3,
             CASE
             	WHEN (coalesce(TRIM(eac_fd.data ->> ''date_eac3''), '''') = '''') IS FALSE THEN 3
             	WHEN (coalesce(TRIM(eac_fd.data ->> ''date_eac2''), '''') = '''') IS FALSE THEN 2
             	WHEN (coalesce(TRIM(eac_fd.data ->> ''date_eac1''), '''') = '''') IS FALSE THEN 1
             ELSE 0
             END AS eac_sessions,
             CASE
             	WHEN eac_fd.data ->> ''date_sample_collected'' IS NULL
             		OR (coalesce(TRIM(eac_fd.data ->> ''date_sample_collected''), '''') = '''') THEN ''No''
             	ELSE ''Yes''
             END repeat_vl,
             eac_fd.data ->> ''date_sample_collected'' AS eac_vl_repeat_date,
             rank() over(PARTITION BY eac_enc.patient_id ORDER BY eac_enc.date_encounter DESC) rn
      FROM encounter eac_enc
      LEFT JOIN form_data eac_fd ON eac_fd.encounter_id = eac_enc.id
      WHERE eac_enc.form_code = ''e856bdfc-16e0-413e-aab1-afbe5c717caf''  -- less than the reporting period
      AND eac_enc.archived = 0
		AND eac_enc.date_encounter <= ? ) enc
   WHERE rn = 1 ),

     patient AS
  (SELECT p.id,
          p.patient_number,
          p.details ->> ''dob'' AS dob,
          p.details -> ''gender'' ->> ''display'' AS gender,
          EXTRACT(YEAR FROM AGE(?, (p.details ->> ''dob'')::date)) AS age
   FROM patient p
   WHERE p.archived = 0
   )

SELECT patient.id,
       patient.patient_number,
       patient.gender,
       patient.dob,
       patient.age,
       pharmacy.current_regimen,
       pharmacy.date_last_refill,
       pharmacy.last_refill_duration,
       pharmacy.current_regimen_line,
       tpt_pharmacy.tpt_start_date,
       tpt_pharmacy.tpt_given,
       laboratory.last_viral_load_date,
       laboratory.last_viral_load,
       laboratory.viral_load_type,
       clinic_followup.pregnancy_status,
       enrollment.patient_id,
       enrollment.entryPoint,
       enrollment.date_confirmed_hiv,
       enrollment.enrollment_setting,
       art_commencement.date_art_start,
       art_commencement.first_regimen_line,
       art_commencement.first_regimen,
       client_status.current_status,
       dmoc.dmoc_date,
       dmoc.dmoc_type,
       dmoc.dmoc_commenced,
       eac.eac_commenced,
       eac.date_eac_commenced,
       eac.date_eac2,
       eac.date_eac3,
       eac.eac_sessions,
       eac.repeat_vl,
       eac.eac_vl_repeat_date
FROM enrollment
LEFT JOIN patient ON patient.id = enrollment.patient_id
LEFT JOIN pharmacy ON pharmacy.patient_id = enrollment.patient_id
LEFT JOIN laboratory ON laboratory.patient_id = enrollment.patient_id
LEFT JOIN clinic_followup ON clinic_followup.patient_id = enrollment.patient_id
LEFT JOIN art_commencement ON art_commencement.patient_id = enrollment.patient_id
LEFT JOIN client_status ON client_status.patient_id = enrollment.patient_id
LEFT JOIN dmoc ON dmoc.patient_id = enrollment.patient_id
LEFT JOIN eac ON eac.patient_id = enrollment.patient_id
LEFT JOIN tpt_pharmacy ON tpt_pharmacy.patient_id = enrollment.patient_id

]]></xml-property>
