            <xml-property name="queryText"><![CDATA[ WITH art_commencement AS
  (SELECT art_enc.patient_id,
   		  art_fd.data ->> ''date_art_start'' as date_enrolled,
          art_fd.data -> ''tb_status''  ->> ''display'' as tb_status,
		  art_fd.data -> ''pregnancy_status''  ->> ''display'' as pregnancy_status
   FROM encounter art_enc
   INNER JOIN form_data art_fd ON art_fd.encounter_id = art_enc.id
   WHERE art_enc.form_code = ''0a8b31d2-9397-42f8-9300-688b62c75571'' AND art_enc.archived = 0
   AND art_enc.organisation_unit_id = ?
  	AND EXTRACT(YEAR FROM (art_fd.data ->> ''date_art_start'')::timestamp) = ?
AND EXTRACT(MONTH FROM (art_fd.data ->> ''date_art_start'')::timestamp) = ?),

   enrollment AS
     (SELECT enrollment_enc.patient_id, enrollment_fd.data -> ''status_registration''  ->> ''display'' as registration_status
      FROM encounter enrollment_enc
      INNER JOIN form_data enrollment_fd ON enrollment_fd.encounter_id = enrollment_enc.id
      WHERE enrollment_enc.form_code = ''0871d0b9-0fb3-4579-bdec-77d684b0cea6''
	 	AND enrollment_fd.data -> ''status_registration'' ->> ''display'' != ''ART Transfer In'' AND enrollment_enc.archived = 0
	 	AND enrollment_enc.organisation_unit_id = ?),

   patient AS
  (SELECT p.id,
          p.details -> ''gender'' ->> ''display'' AS gender,
          EXTRACT(YEAR FROM AGE(?, (p.details ->> ''dob'')::date)) AS age
   FROM patient p WHERE p.archived = 0 AND p.organisation_unit_id = ?)

   SELECT art_commencement.patient_id, art_commencement.date_enrolled, art_commencement.tb_status, art_commencement.pregnancy_status,
   			enrollment.registration_status, patient.gender, patient.age
			FROM art_commencement JOIN patient on art_commencement.patient_id = patient.id
			JOIN enrollment on art_commencement.patient_id = enrollment.patient_id]]></xml-property>
