            <xml-property name="queryText"><![CDATA[-- ART 6
SELECT distinct e.patient_id, lab_fd.data,
p.details -> ''gender'' ->> ''display'' as gender,
EXTRACT(YEAR from AGE(NOW(), (p.details ->> ''dob'')::date)) as age
FROM encounter e
inner join patient p on e.patient_id = p.id
inner join form_data lab_fd on lab_fd.encounter_id = e.id and e.form_code = ''87cb9bc7-ea0d-4c83-a70d-b57a5fb7769e''
WHERE EXTRACT(YEAR FROM (lab_fd.data-> ''reported_result''->-1->> ''date_result_reported'')::date) = ?
AND EXTRACT(MONTH FROM (lab_fd.data-> ''reported_result''->-1->>''date_result_reported'')::date) = ?
AND lab_fd.data ->> ''description'' ilike ''Viral load''
AND (lab_fd.data-> ''reported_result''->-1->>''result_reported'') ~ ''^[0-9\.]+$''
AND TO_NUMBER((lab_fd.data-> ''reported_result''->-1->>''result_reported''), ''9G999g999'')  <= 1000
AND e.organisation_unit_id = ?
AND e.archived = 0
]]></xml-property>
